import React from 'react';
import Backdrop from "../Backdrop/Backdrop";

const Confirm = () => {
    return (
        <Backdrop>
            <div>
                <p>Are you sure to clear the cart?</p>
                <div>
                    <button>Yes</button>
                    <button>No</button>
                </div>
            </div>
        </Backdrop>
    );
};

export default Confirm;
